dc3c5c85-83c4-45c5-8ae3-4ace7e792f36.text:
n = int(raw_input())
S = [raw_input() for i in xrange(n)]
cnt = [10**9]*28
for s in S:
    for i in xrange(27):
        cnt[i] = min(cnt[i], s.count(chr(ord("a") + i)))
for i in xrange(27):
    cnt[i] = cnt[i] if cnt[i] < 10**9 else 0
ans = ""
for i in xrange(27):
    ans += chr(ord("a") + i)*cnt[i]
print ans
